import { MIN_ZOOM_SCALE as r, MAX_ZOOM_SCALE as t } from "./constants.js";
const e = (o) => o * 100 <= r, i = (o) => o * 100 >= t;
export {
  i as isZoomInDisabled,
  e as isZoomOutDisabled
};
